import React from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faJetFighter} from "@fortawesome/free-solid-svg-icons"

function Logo(props){
    return(
        <div className="logo">
        <FontAwesomeIcon icon={faJetFighter} />
      </div>
    );
}

export default Logo;
